import React from "react";

import Headshot from './headshot.JPG';

function Summary () {
    return (
        <div className="summary-container">
            <image className="headshot" src={Headshot} alt="headshot of author" />
            <h3 className="salutation"> Hi there... I'm</h3>
            <h2>Naveen Satanarachchi</h2>
            <p className="bio">Organized and motivated Software Engineering graduate 
            eager to apply front-end development, time management and organizational 
            skills in various environments. Seeking entry-level opportunities to expand skills while facilitating company growth.</p>
        </div>
    );
}

export default Summary;
